    dislikes: 12
  },
]
};

export const deleteMovie = (state = initState, action) => {
  switch (action.type) {
    case "DELETE_MOVIE":
      const article = state.todos.filter((todo, i) => i !== action.payload);
      return {
        ...state,
        todos: article
      };
    case "DELETE_ALL":
      return { ...state, todos: [], text: "" };
    default:
      return state;
  }
};
